import { combineReducers, configureStore, getDefaultMiddleware } from "@reduxjs/toolkit";
import CryptApi from "../features/posts/Mutaion";
import { setupListeners } from "@reduxjs/toolkit/dist/query";

import { persistStore, persistReducer } from 'redux-persist'
import storage from 'redux-persist/lib/storage'
import PersonneApi from "../features/listePersonne/MutationPersonne";
const persistConfig = {
    key: "root",
    storage,
}
const rootReducer = combineReducers({
   // users: userReducer,
    // annonce: annonceReducer,
    // comments: commentsReducer,
    // categories: categoriesReducer,
    // conversation: conversationReducer,
    // ville: villeReducer,
    // message: messageReducer,
    // notification: notificationReducer,
    // allNotification: allNotificationReducer,
    // userAnnonce: userAnnonceReducer,
    // socket: socketReducer,
    [CryptApi.reducerPath]: CryptApi.reducer,
    [AnnonceMutationUrl.reducerPath]: AnnonceMutationUrl.reducer,
    [UserApi.reducerPath]: UserApi.reducer,
    [PersonneApi.reducerPath]: PersonneApi.reducer,
    // posts: postsReducer,  // auth: authetificationReducer,

})
const persistedReducer = persistReducer(persistConfig, rootReducer)

export const store = configureStore({

    reducer: persistedReducer,

    middleware: (getDefaultMiddleware) =>
        getDefaultMiddleware({ serializableCheck: false }).concat(
            CryptApi.middleware,
            AnnonceMutationUrl.middleware,
            UserApi.middleware,
            PersonneApi.middleware,
        ),


});

setupListeners(store.dispatch)


export const persistor = persistStore(store)
